import React from "react";

const WomanDetail = ({ displayedWoman }) => {
  return (
    <div className="ui items">
      <div className="item">
        <div className="image">
          <img src="" />
        </div>
        <div className="content">
          <a className="header">{displayedWoman}</a>
          <div className="meta">
            <span>Description</span>
          </div>
          <div className="description">
            <p>sadfashfd</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default WomanDetail;
